  \"Nutrients and zooplankton data from net and bottle casts from the ALAMINOS and
  other platforms from the South Pacific Ocean and other locations from 31 January
  1967 to 23 September 1967 (NODC Accession 9500089)\",\n\t\"tracking_summary\": {\n\t\t\"total\":
