  false,\n\t\"url\": null,\n\t\"notes\": \"Nutrients and zooplankton data were collected
  from net and bottle casts from the ALAMINOS and other platforms in the South Pacific
  Ocean and other locations. Data were collected by Scripps Institute of Oceanography
  (SIO) from 31 January 1967 to 23 September 1967. Bottle data include concentrations
  of chlorophyll A, phaoepigment, phosphate, nitrate, ammonium, and total pigment.
  Zooplankton samples were obtained from oblique tows and parameters include maximum
  tow depth, total water volume passed through net, small plankton volume, total plankton
  volume, and standard haul factor.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
